    public class FIMIHelper
    {
        static string fimi_types = "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!--********************************************************************************************-->\r\n<!--*************************************** FIMI 16.29   ***************************************-->\r\n<!--*************************************** TWO 5.3.49.1 ***************************************-->\r\n<!--********************************************************************************************-->\r\n<xs:schema xmlns:xs=\"http://www.w3.org/2001/XMLSchema\"\r\n           xmlns:st=\"http://schemas.compassplus.com/two/1.0/fimi_types.xsd\"\r\n           xmlns:ns=\"http://schemas.compassplus.com/two/1.0/fimi_types.xsd\"\r\n           xmlns:user=\"http://schemas.compassplus.com/two/1.0/fimi_userdefined.xsd\"\r\n           targetNamespace=\"http://schemas.compassplus.com/two/1.0/fimi_types.xsd\" elementFormDefault=\"qualified\">\r\n    <xs:import namespace=\"http://schemas.compassplus.com/two/1.0/fimi_userdefined.xsd\" schemaLocation=\"fimi_userdefined.xsd\"/>\r\n<!--*********************************Common simple type*****************************************-->\r\n    <xs:simpleType name=\"tFIMIClerk\">\r\n        <xs:annotation>\r\n           <xs:documentation>FIMI clerk(operator) name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"30\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tFIMIClerkPasswordVersion\">\r\n       <xs:annotation>\r\n          <xs:documentation/>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:enumeration value=\"1\"/> <!--3DES-->\r\n          <xs:enumeration value=\"2\"/> <!--SHA3-256-->\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tFlag\">\r\n       <xs:annotation>\r\n          <xs:documentation>Field flag, values true/on, false/off</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n            <xs:enumeration value=\"0\"/>\r\n            <xs:enumeration value=\"1\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tChangeReason\">\r\n       <xs:annotation>\r\n          <xs:documentation>Description reason operation</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"1000\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tElementReturnCount\">\r\n        <xs:annotation>\r\n           <xs:documentation>Number of requested data</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"1000\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"FaultCodes\">\r\n       <xs:annotation>\r\n          <xs:documentation/>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:enumeration value=\"2\"/>\r\n          <xs:enumeration value=\"5\"/>\r\n          <xs:enumeration value=\"6\"/>\r\n          <xs:enumeration value=\"7\"/>\r\n          <xs:enumeration value=\"8\"/>\r\n          <xs:enumeration value=\"9\"/>\r\n          <xs:enumeration value=\"11\"/>\r\n          <xs:enumeration value=\"12\"/>\r\n          <xs:enumeration value=\"13\"/>\r\n          <xs:enumeration value=\"14\"/>\r\n          <xs:enumeration value=\"15\"/>\r\n          <xs:enumeration value=\"21\"/>\r\n          <xs:enumeration value=\"22\"/>\r\n          <xs:enumeration value=\"23\"/>\r\n          <xs:enumeration value=\"31\"/>\r\n          <xs:enumeration value=\"41\"/>\r\n          <xs:enumeration value=\"42\"/>\r\n          <xs:enumeration value=\"51\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tUID\">\r\n        <xs:annotation>\r\n           <xs:documentation>UID object</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tEmail\">\r\n       <xs:annotation>\r\n          <xs:documentation>E-mail</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"300\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPhoneNumber\">\r\n       <xs:annotation>\r\n          <xs:documentation>Phone number</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"30\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Transaction-->\r\n    <xs:simpleType name=\"tTaxId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Tax Id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"20\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTaxReasonRegCode\">\r\n        <xs:annotation>\r\n           <xs:documentation>Tax reason registration code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"10\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAuthResponceCode\">\r\n       <xs:annotation>\r\n          <xs:documentation>Authorization responce code, values see. 3.9 in FIMI protocol</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"98\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAuthResponceCodeCategory\">\r\n        <xs:annotation>\r\n           <xs:documentation>Authorization responce code category</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--None-->\r\n           <xs:enumeration value=\"1\"/> <!--Do not try again-->\r\n           <xs:enumeration value=\"2\"/> <!--Cannot approve at this time, try again later-->\r\n           <xs:enumeration value=\"3\"/> <!--New account information available-->\r\n           <xs:enumeration value=\"4\"/> <!--Token requirements not fulfilled for this token type-->\r\n           <xs:enumeration value=\"5\"/> <!--Payment Cancellation-->\r\n           <xs:enumeration value=\"6\"/> <!--Merchant does not qualify for product code-->\r\n           <xs:enumeration value=\"7\"/> <!--Retry after 1 hour-->\r\n           <xs:enumeration value=\"8\"/> <!--Retry after 24 hours-->\r\n           <xs:enumeration value=\"9\"/> <!--Retry after 2 days-->\r\n           <xs:enumeration value=\"10\"/> <!--Retry after 4 days-->\r\n           <xs:enumeration value=\"11\"/> <!--Retry after 6 days-->\r\n           <xs:enumeration value=\"12\"/> <!--Retry after 8 days-->\r\n           <xs:enumeration value=\"13\"/> <!--Retry after 10 days-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDetailedAuthResponceCode\">\r\n       <xs:annotation>\r\n          <xs:documentation>Detailed authorization responce code, values see. 3.9 in FIMI protocol</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionNetwork\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction network</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"1\"/>\r\n          <xs:maxInclusive value=\"99\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tISOCodeCurrency\">\r\n       <xs:annotation>\r\n          <xs:documentation>Currency ISO-code in TWO</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tISO3CharCodeCurrency\">\r\n       <xs:annotation>\r\n          <xs:documentation>Currency 3 char ISO-code in TWO</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"3\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tISOCodeCountry\">\r\n       <xs:annotation>\r\n          <xs:documentation>Country ISO-code in TWO</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tMerchantInitiatedTran\">\r\n        <xs:annotation>\r\n           <xs:documentation>Mask additional attributes on the transaction initiated by entering the card data (or their analog) from the merchant data storage</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"127\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction identifier</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:long\">\r\n           <xs:totalDigits value=\"12\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionCode\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction Code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"4\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction Type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"100\"/> <!--AuthRequest-->\r\n           <xs:enumeration value=\"120\"/> <!--AuthAdvice-->\r\n           <xs:enumeration value=\"200\"/> <!--Request-->\r\n           <xs:enumeration value=\"220\"/> <!--Advice-->\r\n           <xs:enumeration value=\"400\"/> <!--ReversalRequest-->\r\n           <xs:enumeration value=\"420\"/> <!--Reversal-->\r\n           <xs:enumeration value=\"422\"/> <!--IssuerRequest-->\r\n           <xs:enumeration value=\"442\"/> <!--IssuerReversal-->\r\n           <xs:enumeration value=\"600\"/> <!--AdminAdvice-->\r\n           <xs:enumeration value=\"999\"/> <!--Admin-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction number assigned by initiator</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"50\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tExternalTransactionNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction Id(TID) in external system</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionDeclineReason\">\r\n        <xs:annotation>\r\n           <xs:documentation>Decline reason transaction</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"4000\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTransactionPartitionName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Transaction partition name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"40\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAmount\">\r\n        <xs:annotation>\r\n           <xs:documentation>Amount</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"-999999999999.999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPositiveAmount\">\r\n        <xs:annotation>\r\n           <xs:documentation>Amount, greater or equal 0</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tAmount\">\r\n          <xs:minInclusive value=\"0\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPrizeQuantity\">\r\n        <xs:annotation>\r\n           <xs:documentation>Prize quantity value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"-999999999999.999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tMerchantCategoryCode\">\r\n        <xs:annotation>\r\n           <xs:documentation>MCC(SIC)</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"4\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRiskLevel\">\r\n        <xs:annotation>\r\n           <xs:documentation>Risk level terminal/retailer</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"3\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n          <xs:minInclusive value=\"0\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Card-->\r\n    <xs:simpleType name=\"tCardMember\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card member number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardMemberWithAny\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card member number with any value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"-1\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"19\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardUID\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card UID</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"64\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tStrCardCVV2\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card CVV2 in string format</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"3\"/>\r\n           <xs:pattern value=\"[0-9][0-9][0-9]\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tIntCardCVV2\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card CVV2 in integer format</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:minInclusive value=\"0\"/>\r\n          <xs:maxInclusive value=\"999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardPVV\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card PVV/IPVV/PINOffset value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:long\">\r\n           <xs:totalDigits value=\"12\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardPVKI\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card PVKI value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tNameOnCard\">\r\n        <xs:annotation>\r\n           <xs:documentation>Customer name on card</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"250\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardProfile\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card profile id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"9\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAuthSchemeId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Authorization scheme id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"9\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"2\"/>\r\n           <xs:enumeration value=\"0\"/> <!--Not active-->\r\n           <xs:enumeration value=\"1\"/> <!--Open-->\r\n           <xs:enumeration value=\"2\"/> <!--Lost-->\r\n           <xs:enumeration value=\"3\"/> <!--Stolen-->\r\n           <xs:enumeration value=\"4\"/> <!--Restricted-->\r\n           <xs:enumeration value=\"5\"/> <!--VIP-->\r\n           <xs:enumeration value=\"6\"/> <!--Open Domestic-->\r\n           <xs:enumeration value=\"8\"/> <!--Compromised-->\r\n           <xs:enumeration value=\"9\"/> <!--Closed-->\r\n           <xs:enumeration value=\"10\"/> <!--Referral-->\r\n           <xs:enumeration value=\"12\"/> <!--Declared-->\r\n           <xs:enumeration value=\"15\"/> <!--Expired-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"1\"/> <!--Plastic card-->\r\n           <xs:enumeration value=\"2\"/> <!--Telebank id-->\r\n           <xs:enumeration value=\"3\"/> <!--Vitual card-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardAlphaNumericPasswordVersion\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alpha numeric password version for card or TB customer</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"1\"/> <!--SHA-1-->\r\n           <xs:enumeration value=\"2\"/> <!--SHA-256-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardAlphaNumericPassword\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alpha numeric password for card or TB customer</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"64\"/>\r\n          <xs:pattern value=\"[A-Fa-f\\d]*\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRemoveMissingFlag\">\r\n        <xs:annotation>\r\n           <xs:documentation>Remove missing element flag</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"0\"/> <!--Not remove-->\r\n           <xs:enumeration value=\"1\"/> <!--Remove not exist-->\r\n           <xs:enumeration value=\"2\"/> <!--Remove exist-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"9\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTmpMaxPeriodType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit period type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"1\"/> <!--Single operation-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitPeriodType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit period type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"2\"/>\r\n           <xs:enumeration value=\"0\"/> <!--Absolute-->\r\n           <xs:enumeration value=\"1\"/> <!--Weekly -->\r\n           <xs:enumeration value=\"2\"/> <!--Monthly -->\r\n           <xs:enumeration value=\"3\"/> <!--Quarterly -->\r\n           <xs:enumeration value=\"4\"/> <!--Infinite-->\r\n           <xs:enumeration value=\"5\"/> <!--Single operation-->\r\n           <xs:enumeration value=\"6\"/> <!--Reset in Refresh-->\r\n           <xs:enumeration value=\"7\"/> <!--Yearly-->\r\n           <xs:enumeration value=\"8\"/> <!--Sliding-->\r\n           <xs:enumeration value=\"11\"/> <!--Calendar-->\r\n           <xs:enumeration value=\"12\"/> <!--Daily-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitPeriod\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit period for period type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"9\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitValue\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"-999999999999.999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitMaxValue\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit maximum value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tLimitValue\">\r\n          <xs:minInclusive value=\"0\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tLimitMaxValueWithScheme\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit maximum value (with as scheme value)</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tLimitValue\">\r\n          <xs:minInclusive value=\"-1\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersentageValue\">\r\n        <xs:annotation>\r\n           <xs:documentation>Persentage value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"2\"/>\r\n          <xs:totalDigits value=\"5\"/>\r\n          <xs:maxInclusive value=\"999.99\"/>\r\n          <xs:minInclusive value=\"-999.99\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCounterPeriodType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit period type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"2\"/>\r\n           <xs:enumeration value=\"-1\"/> <!--As scheme-->\r\n           <xs:enumeration value=\"0\"/> <!--Absolute-->\r\n           <xs:enumeration value=\"1\"/> <!--Weekly -->\r\n           <xs:enumeration value=\"2\"/> <!--Monthly -->\r\n           <xs:enumeration value=\"3\"/> <!--Quarterly -->\r\n           <xs:enumeration value=\"4\"/> <!--Infinite-->\r\n           <xs:enumeration value=\"5\"/> <!--Single operation-->\r\n           <xs:enumeration value=\"6\"/> <!--Reset in Refresh-->\r\n           <xs:enumeration value=\"7\"/> <!--Yearly-->\r\n           <xs:enumeration value=\"11\"/> <!--Calendar-->\r\n           <xs:enumeration value=\"12\"/> <!--Daily-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCounterPeriod\">\r\n        <xs:annotation>\r\n           <xs:documentation>Limit period for period type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"9\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCounterValue\">\r\n        <xs:annotation>\r\n           <xs:documentation>Counter value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"-999999999999.999\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCounterMaxValue\">\r\n        <xs:annotation>\r\n           <xs:documentation>Counter maximum value</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tCounterValue\">\r\n          <xs:minInclusive value=\"-2\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardToken\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card token number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"19\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardTokenStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card token status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"2\"/>\r\n           <xs:enumeration value=\"1\"/> <!--Active-->\r\n           <xs:enumeration value=\"2\"/> <!--Not active-->\r\n           <xs:enumeration value=\"3\"/> <!--Suspended-->\r\n           <xs:enumeration value=\"4\"/> <!--Disabled-->\r\n           <xs:enumeration value=\"10\"/> <!--Delete from device-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTokenType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Token type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"0\"/> <!--Unknown-->\r\n           <xs:enumeration value=\"1\"/> <!--E-Commerce/card on file-->\r\n           <xs:enumeration value=\"2\"/> <!--Secure element-->\r\n           <xs:enumeration value=\"3\"/> <!--Cloud-based payment;-->\r\n           <xs:enumeration value=\"5\"/> <!--E-Commerce enabler-->\r\n           <xs:enumeration value=\"6\"/> <!--Pseudo account-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tEventRequestor\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card token status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"0\"/> <!--Wallet Service Provider -->\r\n           <xs:enumeration value=\"1\"/> <!--Issuer-->\r\n           <xs:enumeration value=\"2\"/> <!--Cardholder-->\r\n           <xs:enumeration value=\"3\"/> <!--Mobile PIN Security -->\r\n           <xs:enumeration value=\"4\"/> <!--Mobile PIN Change Security -->\r\n           <xs:enumeration value=\"5\"/> <!--Carrier Issuer Carrier Issuer -->\r\n           <xs:enumeration value=\"6\"/> <!--Third-party Service Provider-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardTokenRequestorId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Card token requestor id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:long\">\r\n           <xs:totalDigits value=\"11\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPSCardReferenceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Payment system card reference id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"48\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tEMVScriptType\">\r\n        <xs:annotation>\r\n           <xs:documentation>EMV script type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"1\"/>\r\n           <xs:enumeration value=\"1\"/> <!--Application block-->\r\n           <xs:enumeration value=\"2\"/> <!--Card block-->\r\n           <xs:enumeration value=\"3\"/> <!--Pin unblock-->\r\n           <xs:enumeration value=\"4\"/> <!--Put data-->\r\n           <xs:enumeration value=\"5\"/> <!--Update record-->\r\n           <xs:enumeration value=\"6\"/> <!--Application unblock-->\r\n           <xs:enumeration value=\"7\"/> <!--PIN change-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCardPlasticTypeId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Plastic type id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPINBlockUnderWK\">\r\n        <xs:annotation>\r\n           <xs:documentation>PIN Block under working key</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"32\"/>\r\n          <xs:pattern value=\"[A-Fa-f\\d\\s]*\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPINBlockUnderWK_LMK\">\r\n        <xs:annotation>\r\n           <xs:documentation>PIN Block under working key or LMK</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"66\"/>\r\n          <xs:pattern value=\"[A-Fa-f\\d\\s]*\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Telebank-->\r\n    <xs:simpleType name=\"tTBCardMember\">\r\n        <xs:annotation>\r\n           <xs:documentation>Telebank member number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tCardMember\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTBCardNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Telebank number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tCardNumber\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTBCardUID\">\r\n        <xs:annotation>\r\n           <xs:documentation>Telebank card UID</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tCardUID\"/>\r\n    </xs:simpleType>\r\n<!--Account-->\r\n    <xs:simpleType name=\"tAccountNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"30\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountUID\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account UID</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/>  <!--Checking-->\r\n           <xs:enumeration value=\"11\"/> <!--Savings-->\r\n           <xs:enumeration value=\"31\"/> <!--Credit-->\r\n           <xs:enumeration value=\"91\"/> <!--Bonus-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountStatus\">\r\n       <xs:annotation>\r\n          <xs:documentation>Account status</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:enumeration value=\"0\"/> <!--Inactive account-->\r\n          <xs:enumeration value=\"1\"/> <!--Open-->\r\n          <xs:enumeration value=\"2\"/> <!--Deposit only-->\r\n          <xs:enumeration value=\"3\"/> <!--Open primary account-->\r\n          <xs:enumeration value=\"4\"/> <!--Deposit only primary account-->\r\n          <xs:enumeration value=\"5\"/> <!--Information only-->\r\n          <xs:enumeration value=\"9\"/> <!--Closed-->\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountToken\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account token</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"100\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountTokenRequestorId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account token requestor id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"100\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountTokenServiceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account token service id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--FPS Pay-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n     <xs:simpleType name=\"tAccountTokenStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account token status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:enumeration value=\"0\"/> <!--New-->\r\n          <xs:enumeration value=\"1\"/> <!--Authorized-->\r\n          <xs:enumeration value=\"2\"/> <!--Active-->\r\n          <xs:enumeration value=\"3\"/> <!--Suspended-->\r\n          <xs:enumeration value=\"4\"/> <!--Blocked-->\r\n          <xs:enumeration value=\"5\"/> <!--Deleting-->\r\n          <xs:enumeration value=\"6\"/> <!--Deleted-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAccountTokenIntentId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Account token intent id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"100\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Customer-->\r\n    <xs:simpleType name=\"tPersonId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Customer id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:long\">\r\n           <xs:totalDigits value=\"16\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonExtId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Customer external id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"50\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonFIO\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer surname, name, patronymic</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"300\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Customer name(first/last/middle)</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"100\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonNameLat\">\r\n        <xs:annotation>\r\n           <xs:documentation>Customer name(first/last/middle) on latin</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"100\"/>\r\n          <xs:pattern value=\"[A-Za-z\\d\\s]*\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonSex\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer sex</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"1\"/>\r\n          <xs:enumeration value=\"M\"/> <!--Male-->\r\n          <xs:enumeration value=\"F\"/> <!--Female-->\r\n          <xs:enumeration value=\"N\"/> <!--Not Specified-->\r\n          <xs:enumeration value=\"U\"/> <!--Unknown-->\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonIdentityType\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer identity type</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:int\">\r\n          <xs:enumeration value=\"1\"/> <!--Pasport-->\r\n          <xs:enumeration value=\"2\"/> <!--Driver's license-->\r\n          <xs:enumeration value=\"3\"/> <!--Insurance number-->\r\n          <xs:enumeration value=\"4\"/> <!--Individual taxpayer number-->\r\n          <xs:enumeration value=\"5\"/> <!--National identifier-->\r\n          <xs:enumeration value=\"6\"/> <!--International passport-->\r\n          <xs:enumeration value=\"7\"/> <!--Military Id-->\r\n          <xs:enumeration value=\"8\"/> <!--Other type of document-->\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonIdentity\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer id for identity type</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"120\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonPassword\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer secret word</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"60\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonBirthPlace\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer birth place</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"250\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tResidentCityInLatin\">\r\n       <xs:annotation>\r\n          <xs:documentation>Resident city(in latin character)</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"100\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tResidentStateInLatin\">\r\n       <xs:annotation>\r\n          <xs:documentation>Resident state(in latin character)</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"50\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAddressInLatin\">\r\n       <xs:annotation>\r\n          <xs:documentation>Address(in latin character)</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"200\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPostalCode\">\r\n       <xs:annotation>\r\n          <xs:documentation>Postal code</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"30\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonConfidentialQuestion\">\r\n       <xs:annotation>\r\n          <xs:documentation>Person Confidential Question</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"150\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonConfidentialAnswer\">\r\n       <xs:annotation>\r\n          <xs:documentation>Person Confidential Answer for Question</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"300\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonPhoneNumber\">\r\n       <xs:annotation>\r\n          <xs:documentation>Person phone number</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"20\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tPersonTaxPayerNumber\">\r\n       <xs:annotation>\r\n          <xs:documentation>Person Tax Payer Number</xs:documentation>\r\n       </xs:annotation>\r\n       <xs:restriction base=\"xs:string\">\r\n          <xs:maxLength value=\"20\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Institution-->\r\n    <xs:simpleType name=\"tInstitutionName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Character identifier (name) of a financial institution</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"4\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tInstitutionBIC\">\r\n        <xs:annotation>\r\n           <xs:documentation>Character BIC (name) of a financial institution</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"20\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tBranchId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Character identifier of branch</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"90\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tBranchName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Name of branch</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"240\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Device-->\r\n    <xs:simpleType name=\"tDeviceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Identificator device in TWO</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDeviceExtId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Identificator device in external system</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"48\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDeviceName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Device name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"99\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDevicePhoneNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Device phone number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"15\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDeviceStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Device status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--Active-->\r\n           <xs:enumeration value=\"2\"/> <!--Blocked-->\r\n           <xs:enumeration value=\"3\"/> <!--Deleted-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tDeviceType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Device type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Unknown-->\r\n           <xs:enumeration value=\"1\"/> <!--Mobile phone-->\r\n           <xs:enumeration value=\"2\"/> <!--Tablet-->\r\n           <xs:enumeration value=\"3\"/> <!--Watch-->\r\n           <xs:enumeration value=\"4\"/> <!--Mobile phone or tablet-->\r\n           <xs:enumeration value=\"5\"/> <!--Personal Computer-->\r\n           <xs:enumeration value=\"6\"/> <!--Card-->\r\n           <xs:enumeration value=\"7\"/> <!--Mobile tag or key fob-->\r\n           <xs:enumeration value=\"8\"/> <!--Wristband-->\r\n           <xs:enumeration value=\"9\"/> <!--Mobile Phone Case-->\r\n           <xs:enumeration value=\"10\"/> <!--Sticker-->\r\n           <xs:enumeration value=\"11\"/> <!--Vehicle-->\r\n           <xs:enumeration value=\"12\"/> <!--Media/Gaming Device-->\r\n           <xs:enumeration value=\"13\"/> <!--Domestic Appliance-->\r\n           <xs:enumeration value=\"14\"/> <!--Jewelry-->\r\n           <xs:enumeration value=\"15\"/> <!--Fashion accessory-->\r\n           <xs:enumeration value=\"16\"/> <!--Garment-->\r\n           <xs:enumeration value=\"17\"/> <!--Wearable Device-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Alias-->\r\n    <xs:simpleType name=\"tAlias\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alias card or account</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"500\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAliasServiceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Service id for transef by alias</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--VISA ADS-->\r\n           <xs:enumeration value=\"2\"/> <!--MC Transfer Hub-->\r\n           <xs:enumeration value=\"3\"/> <!--NCPS FPS C2C-->\r\n           <xs:enumeration value=\"4\"/> <!--NCPS FPS РЎ2B-->\r\n           <xs:enumeration value=\"5\"/> <!--NCPS FPS РЎ2G-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAliasType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alias type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--Phone-->\r\n           <xs:enumeration value=\"2\"/> <!--EMail-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAliasStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alias status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Deleted-->\r\n           <xs:enumeration value=\"1\"/> <!--Active-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAliasServiceMemberId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Member Id for alias servis Id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"12\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tAliasSubscriptionToken\">\r\n        <xs:annotation>\r\n           <xs:documentation>Alias subscription token</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Arrest-->\r\n    <xs:simpleType name=\"tArrestId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Arrest id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tUID\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tArrestExternalId\">\r\n        <xs:annotation>\r\n           <xs:documentation>External system id for arrest</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"250\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--ECMerchant-->\r\n    <xs:simpleType name=\"tECMerchantId\">\r\n        <xs:annotation>\r\n           <xs:documentation>ECommerce merchant id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tUID\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tECMerchantStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>ECommerce merchant status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Not active-->\r\n           <xs:enumeration value=\"1\"/> <!--Active-->\r\n           <xs:enumeration value=\"2\"/> <!--Compromised-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Invoice-->\r\n    <xs:simpleType name=\"tInvoiceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Invoice id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"st:tUID\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tInvoiceStatus\">\r\n        <xs:annotation>\r\n           <xs:documentation>Invoice status</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Rejected-->\r\n           <xs:enumeration value=\"1\"/> <!--Confirmed-->\r\n           <xs:enumeration value=\"2\"/> <!--Pending confirmation-->\r\n           <xs:enumeration value=\"3\"/> <!--Expired-->\r\n           <xs:enumeration value=\"4\"/> <!--Automatic confirmed-->\r\n           <xs:enumeration value=\"5\"/> <!--Finished-->\r\n           <xs:enumeration value=\"6\"/> <!--Confirmed by institute-->\r\n\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tInvoiceType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Invoice type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--EC Decoupled-->\r\n           <xs:enumeration value=\"1\"/> <!--Outgoing FPS C2C Me2Me-->\r\n           <xs:enumeration value=\"2\"/> <!--Incoming FPS C2C Me2Me-->\r\n           <xs:enumeration value=\"3\"/> <!--Outgoing FPS C2G-->\r\n           <xs:enumeration value=\"4\"/> <!--Outgoing FPS C2C-->\r\n           <xs:enumeration value=\"5\"/> <!--Outgoing FPS C2B-->\r\n           <xs:enumeration value=\"6\"/> <!--Outgoing QP pull request FPS C2B-->\r\n           <xs:enumeration value=\"7\"/> <!--Outgoing FPS C2C International-->\r\n           <xs:enumeration value=\"8\"/> <!--Outgoing FPS B2B-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Customer Messaging Service-->\r\n    <xs:simpleType name=\"tCMSChannel\">\r\n        <xs:annotation>\r\n           <xs:documentation>Channel name(Id)</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"20\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCMSAddress\">\r\n        <xs:annotation>\r\n           <xs:documentation>Abonent address</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"500\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCMSMessage\">\r\n        <xs:annotation>\r\n           <xs:documentation>Text message</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tCMSPriority\">\r\n        <xs:annotation>\r\n           <xs:documentation>Send message priority</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Low-->\r\n           <xs:enumeration value=\"1\"/> <!--Below normal-->\r\n           <xs:enumeration value=\"2\"/> <!--Normal-->\r\n           <xs:enumeration value=\"3\"/> <!--Above normal-->\r\n           <xs:enumeration value=\"4\"/> <!--High-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--IssuerHistory-->\r\n    <xs:simpleType name=\"tIssuerHistoryTableName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Object(table) issuer history (see. 3.17.1)</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:enumeration value=\"CRD_CARD\"/>\r\n           <xs:enumeration value=\"CRD_LIMIT\"/>\r\n           <xs:enumeration value=\"CRD_CARDLIMITSRANGES\"/>\r\n           <xs:enumeration value=\"CRD_EMVCARDTAG\"/>\r\n           <xs:enumeration value=\"CRD_EMVSCRIPT\"/>\r\n           <xs:enumeration value=\"CRD_MESSAGING\"/>\r\n           <xs:enumeration value=\"CRD_ACCOUNT\"/>\r\n           <xs:enumeration value=\"CRD_ACCOUNT2CARD\"/>\r\n           <xs:enumeration value=\"CRD_ACCT2CARDLIMIT\"/>\r\n           <xs:enumeration value=\"CRD_ACCTLIMIT\"/>\r\n           <xs:enumeration value=\"CRD_ACCTLIMITSRANGES\"/>\r\n           <xs:enumeration value=\"TLB_CUSTOMER\"/>\r\n           <xs:enumeration value=\"CRD_CARDPASSWORD\"/>\r\n           <xs:enumeration value=\"CRD_PERSON\"/>\r\n           <xs:enumeration value=\"CRD_PERSONINFO\"/>\r\n           <xs:enumeration value=\"CNS_PERSONABONENT\"/>\r\n           <xs:enumeration value=\"CRD_PERSONLIMIT\"/>\r\n           <xs:enumeration value=\"CRD_PERSONLIMITSRANGES\"/>\r\n           <xs:enumeration value=\"CRD_PERSONUSERFIELDS\"/>\r\n           <xs:enumeration value=\"CRD_ACCTUSERFIELDS\"/>\r\n           <xs:enumeration value=\"CRD_CARDUSERFIELDS\"/>\r\n           <xs:enumeration value=\"CRD_TOKENLIMIT\"/>\r\n           <xs:enumeration value=\"CRD_ARRESTS\"/>\r\n           <xs:enumeration value=\"CRD_TOKEN\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Rate-->\r\n    <xs:simpleType name=\"tRateAmount\">\r\n        <xs:annotation>\r\n           <xs:documentation>РЎurrency rate amount</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"6\"/>\r\n          <xs:totalDigits value=\"18\"/>\r\n          <xs:maxInclusive value=\"999999999999.999999\"/>\r\n          <xs:minInclusive value=\"0.000001\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Terminal-->\r\n    <xs:simpleType name=\"tTerminalId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Id terminal</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"16\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalSerialNumber\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal serial number</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"50\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalClass\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal class</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--ATM-->\r\n           <xs:enumeration value=\"2\"/> <!--POS-->\r\n           <xs:enumeration value=\"3\"/> <!--CRT-->\r\n           <xs:enumeration value=\"4\"/> <!--VTBI-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal type</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--ATM NDC-->\r\n           <xs:enumeration value=\"2\"/> <!--ATM DDC-->\r\n           <xs:enumeration value=\"101\"/> <!--POS TPTP Lite-->\r\n           <xs:enumeration value=\"102\"/> <!--POS TPTP Full Option-->\r\n           <xs:enumeration value=\"103\"/> <!--POS TITP-->\r\n           <xs:enumeration value=\"105\"/> <!--POS SUDAPAN-->\r\n           <xs:enumeration value=\"106\"/> <!--POS NAC-->\r\n           <xs:enumeration value=\"201\"/> <!--CRT Terminal-->\r\n           <xs:enumeration value=\"202\"/> <!--Imprinter-->\r\n           <xs:enumeration value=\"301\"/> <!--TeleBank Internet-->\r\n           <xs:enumeration value=\"302\"/> <!--TeleBank Phone-->\r\n           <xs:enumeration value=\"303\"/> <!--TeleBank Voice-->\r\n           <xs:enumeration value=\"305\"/> <!--FIMI-->\r\n           <xs:enumeration value=\"306\"/> <!--E-Commerce-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalTitle\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal title</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"250\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalDescription\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal description</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"750\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalRegion\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal region</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"90\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalCity\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal city</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"90\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalOwner\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal owner</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"90\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalLocation\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal location</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"300\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalZIP\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal ZIP</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"90\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tTerminalTimeOffset\">\r\n        <xs:annotation>\r\n           <xs:documentation>Terminal time offset</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n          <xs:totalDigits value=\"4\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMCashInCasset\">\r\n        <xs:annotation>\r\n           <xs:documentation>Cash in casset ATM terminal</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"0\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMBillValueInCasset\">\r\n        <xs:annotation>\r\n           <xs:documentation>Bill value in casset ATM terminal</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:decimal\">\r\n          <xs:fractionDigits value=\"3\"/>\r\n          <xs:totalDigits value=\"15\"/>\r\n          <xs:maxInclusive value=\"999999999999.999\"/>\r\n          <xs:minInclusive value=\"0\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMDeviceStates\">\r\n        <xs:annotation>\r\n           <xs:documentation>ATM device states</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--OK-->\r\n           <xs:enumeration value=\"1\"/> <!--Routine error-->\r\n           <xs:enumeration value=\"2\"/> <!--Warning-->\r\n           <xs:enumeration value=\"3\"/> <!--Suspend-->\r\n           <xs:enumeration value=\"4\"/> <!--Fatal error-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMMaterialStates\">\r\n        <xs:annotation>\r\n           <xs:documentation>ATM material states</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Not configured-->\r\n           <xs:enumeration value=\"1\"/> <!--OK-->\r\n           <xs:enumeration value=\"2\"/> <!--Low-->\r\n           <xs:enumeration value=\"3\"/> <!--Out-->\r\n           <xs:enumeration value=\"4\"/> <!--Overfill-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMSensorStates\">\r\n        <xs:annotation>\r\n           <xs:documentation>ATM sensor states</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"0\"/> <!--Off-->\r\n           <xs:enumeration value=\"1\"/> <!--On-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n<!--Retailer-->\r\n    <xs:simpleType name=\"tRetailerId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Id retailer</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerGroupId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Id retailer group</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Retailer name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"150\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerTitle\">\r\n        <xs:annotation>\r\n           <xs:documentation>Retailer title</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"150\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerGroupName\">\r\n        <xs:annotation>\r\n           <xs:documentation>Retailer group name</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"30\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n   <xs:simpleType name=\"tRetailerRegionName\">\r\n       <xs:annotation>\r\n          <xs:documentation>Region name</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"60\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerCityName\">\r\n       <xs:annotation>\r\n          <xs:documentation>City name</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"60\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerAddressName\">\r\n       <xs:annotation>\r\n          <xs:documentation>Address name</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"100\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerZIP\">\r\n       <xs:annotation>\r\n          <xs:documentation>Postal code</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"30\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerPhoneNumber\">\r\n       <xs:annotation>\r\n          <xs:documentation>Phone number</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"30\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerServicePhoneNumber\">\r\n       <xs:annotation>\r\n          <xs:documentation>Customer service phone number</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"16\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tRetailerURL\">\r\n       <xs:annotation>\r\n          <xs:documentation>URL</xs:documentation>\r\n       </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"255\"/>\r\n       </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMWithdrawalHoldId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Id withdrawal hold</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\"/>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tATMWithdrawalHoldStatus\">\r\n          <xs:annotation>\r\n             <xs:documentation>Status withdrawal hold</xs:documentation>\r\n          </xs:annotation>\r\n          <xs:restriction base=\"xs:int\">\r\n               <xs:enumeration value=\"1\"/>   <!--Wait For Confirm-->\r\n               <xs:enumeration value=\"2\"/>   <!--Confirmed-->\r\n               <xs:enumeration value=\"11\"/>  <!--Declined-->\r\n               <xs:enumeration value=\"12\"/>  <!--Purged-->\r\n               <xs:enumeration value=\"21\"/>  <!--Withdrawn-->\r\n               <xs:enumeration value=\"22\"/>  <!--Cancelled-->\r\n               <xs:enumeration value=\"23\"/>  <!--Expired-->\r\n          </xs:restriction>\r\n    </xs:simpleType>\r\n<!--QR-->\r\n    <xs:simpleType name=\"tQRCodeType\">\r\n          <xs:annotation>\r\n             <xs:documentation>QR code type</xs:documentation>\r\n          </xs:annotation>\r\n          <xs:restriction base=\"xs:int\">\r\n             <xs:enumeration value=\"1\"/> <!--QR-Static-->\r\n             <xs:enumeration value=\"2\"/> <!--QR-Dynamic-->\r\n             <xs:enumeration value=\"3\"/> <!--QR-CashBox -->\r\n             <xs:enumeration value=\"5\"/> <!--QR-Subscription -->\r\n          </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRPayload\">\r\n        <xs:annotation>\r\n           <xs:documentation>QR code payload</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:base64Binary\">\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRId\">\r\n        <xs:annotation>\r\n           <xs:documentation>QR code id</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n           <xs:maxLength value=\"32\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRStatus\">\r\n          <xs:annotation>\r\n             <xs:documentation>QR code status</xs:documentation>\r\n          </xs:annotation>\r\n          <xs:restriction base=\"xs:int\">\r\n             <xs:enumeration value=\"0\"/> <!--InProgress-->\r\n             <xs:enumeration value=\"1\"/> <!--Accepted-->\r\n             <xs:enumeration value=\"2\"/> <!--Rejected-->\r\n             <xs:enumeration value=\"3\"/> <!--Error-->\r\n             <xs:enumeration value=\"4\"/> <!--Purged-->\r\n             <xs:enumeration value=\"5\"/> <!--Canceled-->\r\n             <xs:enumeration value=\"6\"/> <!--Suspended-->\r\n          </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRServiceId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Service id for QR-code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:enumeration value=\"1\"/> <!--EMVCo QR-->\r\n           <xs:enumeration value=\"3\"/> <!--NCPS FPS C2B(Individual)-->\r\n           <xs:enumeration value=\"4\"/> <!--NCPS FPS B2B(Bussines)-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRImageSize\">\r\n        <xs:annotation>\r\n           <xs:documentation>Image size (in dpi) for QR-code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n           <xs:totalDigits value=\"4\"/>\r\n           <xs:minInclusive value=\"200\"/>\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRImageType\">\r\n        <xs:annotation>\r\n           <xs:documentation>Image type for QR-code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:int\">\r\n            <xs:enumeration value=\"0\"/> <!--No image-->\r\n            <xs:enumeration value=\"1\"/> <!--PNG-->\r\n            <xs:enumeration value=\"2\"/> <!--SVG-->\r\n        </xs:restriction>\r\n    </xs:simpleType>\r\n    <xs:simpleType name=\"tQRPurchaseNetworkId\">\r\n        <xs:annotation>\r\n           <xs:documentation>Purchase network for QR-code</xs:documentation>\r\n        </xs:annotation>\r\n        <xs:restriction base=\"xs:string\">\r\n            